import Container from '../../components/Container';
import Head from 'next/head';

const Index = () => {
  return (
    <Container>
      <Head>
        <title>Home</title>
      </Head>
      <h1>Index</h1>
    </Container>
  );
};

Index.getInitialProps = async (ctx) => {};

export default Index;
